import React from 'react'
import ReactDOM from 'react-dom'
import {res2} from './responsive_02.js'
import { Heading } from './heading.js'
import { addresses, current_user } from './index.js'
import img from './account_02.png'
import { Footer } from './footer.js'
export class Track_progress extends React.Component{
    constructor(){
        super()
        this.state={footer:res2.stats.footer()}
    }
    resize(){
        this.setState({footer:res2.stats.footer()})
    }
    render(){
        return(
            <>
            <Heading logout={this.props.logout}/>
            <Stats/>
            <Leaderboard/>
            <div style={this.state.footer}>
            <Footer/>
            </div>
            </>
        )
    }
}
class Stats extends React.Component{
    constructor(){
        super()
        this.state={stats:{},style:res2.stats.header,image:res2.stats.image(img),info:res2.stats.info(),text:res2.stats.text(),info_02:res2.stats.info_02()}
        fetch('http://localhost:8000/track/getstats',{
            method:'POST',
            body:JSON.stringify(current_user),
            headers:{
                'Content-type':'application/json'
            }
        }).then((res)=>res.json()).then((res)=>{
            this.setState((prev)=>{return {stats:res,style:prev.style,image:prev.image,info:prev.info,text:prev.text,info_02:prev.info_02}})
        })
        this.resize=this.resize.bind(this)

    }
    componentDidMount(){
        addresses.Stats=this
    }
    componentDidUpdate(){
        addresses.Stats=this
    }
    resize(){
        this.setState((prev)=>{return {stats:prev.stats,style:res2.stats.header,image:res2.stats.image(img),info:res2.stats.info(),text:res2.stats.text(),info_02:res2.stats.info_02()}})
    }
    render()
    {
        return<>
        <div style={this.state.image}>
        </div>
        <div style={this.state.info_02}>{`username  :   ${current_user.username}`}</div>
        <br/>
        <div style={this.state.info_02}>{`E-mail  :   ${current_user.email}`}</div>

        <div style={this.state.info}>
            <textarea style={this.state.text} value={`Score\t\t\t:${this.state.stats.score}`}></textarea>
            <textarea style={this.state.text}value={`Accuracy\t\t:${this.state.stats.accuracy}%`}></textarea>
            <textarea style={this.state.text}value={`Rank\t\t\t:${this.state.stats.rank}`}></textarea>
        </div>
        </>
    }
}
class Leaderboard extends React.Component{
    constructor(){
        super()
        this.state={style:res2.stats.leaderboard(),arr:[],header:res2.stats.header(),heading:res2.stats.heading()}
        fetch('http://localhost:8000/track/getleaderboard',{
            method:"POST",
            headers:{
                "Content-type":'application/json'
            },
            body:JSON.stringify(current_user)
        }).then((res)=>res.json()).then((res)=>{
            this.setState((prev)=>{return{arr:res,style:prev.style,header:prev.header,heading:prev.heading}})
        })
    }
    render(){
        return  <>
        <h1 style={this.state.heading}>Leaderboard</h1>
        <table style={this.state.style}> 
           <tr style={this.state.header}>
                  <th >Rank</th>
                 <th >User</th>
                 <th >Score</th>
             </tr>
             {
                this.state.arr.map((info,ind)=>{
                    return<>
                    <tr >
                        <td >{ind+1}</td>
                        <td >{info[0]}</td>
                        <td >{info[1]}</td>
                    </tr>
                    </>
                })
             }
             </table>
             </>
    }
}



